import React from "react";


function WebDevHeader() {
    return (
        <header className="header-name">
            <h2 className="web-en">WEB DEVELOPMENT</h2>
            <h3 className="web-ja" lang="ja">ウェブ　プログラミング</h3>
        </header>
    );
}

export default WebDevHeader;
